   $(document).ready(function(){
     $('<div id="injectHead"><p align="center"> The most affordable way to start a collection of pure elements is to begin scrounging around the house for bits of copper, iron and a few other easily obtainable samples. Short of that Luciteria provides an economical alternative with these screwtop containers that include small amounts of high grade purified elements. At 31mm diameter each they are sized to fit our medium display case but will look just fine on their own too. And by being safely behind the clear plastic wall can be held without worry of soiling the sample or coming into contact with potentially hazardous chemicals. In each case below we provide a minimum of one gram (and typically more) except for the gases, and the reactive and precious metals which are about 100mg each. Gram for gram they are a little more expensive than in the elements section but the difference here is that in every instance you will get a handpicked specimen worthy of being displayed on a pedestal! <p>We are located in Washington State USA and with few exceptions, as noted, we can ship element samples to most countries quickly and at the most reasonable rates. Your cart will give you delivery costs prior to sending payment but please let us know if you have any questions - we\'re always glad to help!</p></div>' ).insertBefore( ".main-nav" );
